import styled from "styled-components"
import windImg from "../../assets/wind.png"

export default function WindDirectionSpeed({ windDirection, windSpeed }) {
    const windD =[];
    const windS=[];

    for (let i = 0; i < windDirection.length; i++) {
        let obj = { direction: windDirection[i] }
        windD.push(obj);
    }
    for (let i = 0; i < windSpeed.length; i++) {
        let obj = { direction: windSpeed[i] }
        windS.push(obj);
    }

    return (
        <Content>
                        <>
            {windD.map((value, index) => (
                    <Wind
                        key={index}
                    />
                ))}
            </>
            <>
                {windS.map((value, index) => (
                    <WindSpeed
                        key={index}
                        speed={value.speed}
                    />
                ))}
                {windD.map((value, index) => (
                    <WDirection
                        key={index}
                        direction={value.direction}
                    />
                ))}
            </>
        </Content>
    )
}

function Wind(){

    return(
        <><img src={windImg}/>
</>
    )
}
function WindSpeed({ speed }) {
    console.log(speed)
    return (
        <>{speed}</>
    )
}

function WindDirection({ direction }) {
    return (
        <>{direction}</>
    )
}

const Content= styled.div`
border: 2px solid green;
width: 100%;
`
